description:
28 Days were a punk rock band formed in Frankston, Australia during 1997. At their career peak, they had a #1 album (Upstyledown) on the Australian ARIAnet Albums Chart and also a #12 single (&quot;Rip It Up&quot;) on the ARIAnet Singles Chart.

